import {motion} from "framer-motion";

const Landing = () => {
  return <>
    <motion.div
      initial={{ x: 300, opacity: 0 }}
      animate={{ x: 0, opacity: 1 }}
      exit={{ x: -300, opacity: 0 }}
    >
      <h3 class="whisper-text">szalations</h3>
    </motion.div>

    <button class="enter">enter</button>
  </>;
}

export default Landing;
